document.addEventListener("DOMContentLoaded",(function(){var e=document.querySelector(".main-nav__toggle"),t=document.querySelector(".main-nav");e.addEventListener("click",(function(a){a.preventDefault(),t.classList.contains("main-nav--active")?(t.classList.remove("main-nav--active"),e.classList.remove("toggle--active")):(t.classList.add("main-nav--active"),e.classList.add("toggle--active"))}))}));